import React from "react";
import Card from "./Card";


const Netf = () =>{

    return(
        <Card 
        key={Ncard[0].id}
        imgscr ={Ncard[0].imgscr} 
        title = {Ncard[0].title} 
        sname = {Ncard[0].sname} 
        link = {Ncard[0].link}                 
        />
     );
}

export default Netf;
